public static int func(int n,List<Integer> set, int count, boolean[] visited ){

    if(set.contains(n*n) && visited[n*n]==false){
        visited[n*n] = true;
        func(n*n, set, count+1, visited);
    }

    return count;

}
    public static int longestSquareStreak(int[] arr) {
        int count  = 0;
        int n = arr.length;

        boolean[] visited = new boolean[100001];
        List<Integer> set = new ArrayList<>();
        for(int i=0;i<n;i++){
            int x = arr[i];
            set.add(x);
        }
        Collections.sort(set);
        System.out.println(set);
        for(int x:set){
            if(x!=1 && visited[x]==false){
                count++;
                visited[x] = true;
                func(x, set, 0, visited);
            }
        }
        count = n-count;
        return count==0?-1:count+1;
    }
